Within the pseudo-module the app attribute expects to find an initialization function marked with the init attribute. This function must have signature fn(init::Context) [-> init::LateResources] (the return type is not always required). This initialization function will be the first part of the application to run. The init function will run with interrupts disabled and has exclusive access to Cortex-M and, optionally, device specific peripherals through the core and device fields of init::Context. static mut variables declared at the beginning of init will be transformed into &'static mut references that are safe to access. The example below shows the types of the core and device fields and showcases safe access to a static mut variable. The device field is only available when the peripherals argument is set to true (it defaults to false). //! examples/init.rs #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] use cortex_m_semihosting::{debug, hprintln};
use panic_semihosting as _; #[rtic::app(device = lm3s6965, peripherals = true)]
const APP: () = { #[init] fn init(cx: init::Context) { static mut X: u32 = 0; // Cortex-M peripherals let _core: cortex_m::Peripherals = cx.core; // Device specific peripherals let _device: lm3s6965::Peripherals = cx.device; // Safe access to local `static mut` variable let _x: &'static mut u32 = X; hprintln!("init").unwrap(); debug::exit(debug::EXIT_SUCCESS); }
}; Running the example will print init to the console and then exit the QEMU process. $ cargo run --example init
init

