To declare interrupt handlers the framework provides a #[task] attribute that can be attached to functions. This attribute takes a binds argument whose value is the name of the interrupt to which the handler will be bound to; the function adornated with this attribute becomes the interrupt handler. Within the framework these type of tasks are referred to as hardware tasks, because they start executing in reaction to a hardware event. The example below demonstrates the use of the #[task] attribute to declare an interrupt handler. Like in the case of #[init] and #[idle] local static mut variables are safe to use within a hardware task. //! examples/hardware.rs #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] use cortex_m_semihosting::{debug, hprintln};
use lm3s6965::Interrupt;
use panic_semihosting as _; #[rtic::app(device = lm3s6965)]
const APP: () = { #[init] fn init(_: init::Context) { // Pends the UART0 interrupt but its handler won't run until *after* // `init` returns because interrupts are disabled rtic::pend(Interrupt::UART0); // equivalent to NVIC::pend hprintln!("init").unwrap(); } #[idle] fn idle(_: idle::Context) -> ! { // interrupts are enabled again; the `UART0` handler runs at this point hprintln!("idle").unwrap(); rtic::pend(Interrupt::UART0); debug::exit(debug::EXIT_SUCCESS); loop {} } #[task(binds = UART0)] fn uart0(_: uart0::Context) { static mut TIMES: u32 = 0; // Safe access to local `static mut` variable *TIMES += 1; hprintln!( "UART0 called {} time{}", *TIMES, if *TIMES > 1 { "s" } else { "" } ) .unwrap(); }
}; $ cargo run --example hardware
init
UART0 called 1 time
idle
UART0 called 2 times So far all the RTIC applications we have seen look no different than the applications one can write using only the cortex-m-rt crate. From this point we start introducing features unique to RTIC.

