Late resources are resources that are not given an initial value at compile time using the #[init] attribute but instead are initialized at runtime using the init::LateResources values returned by the init function. Late resources are useful for moving (as in transferring the ownership of) peripherals initialized in init into interrupt handlers. The example below uses late resources to establish a lockless, one-way channel between the UART0 interrupt handler and the idle task. A single producer single consumer Queue is used as the channel. The queue is split into consumer and producer end points in init and then each end point is stored in a different resource; UART0 owns the producer resource and idle owns the consumer resource. //! examples/late.rs #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] use cortex_m_semihosting::{debug, hprintln};
use heapless::{ consts::*, i, spsc::{Consumer, Producer, Queue},
};
use lm3s6965::Interrupt;
use panic_semihosting as _; #[rtic::app(device = lm3s6965)]
const APP: () = { // Late resources struct Resources { p: Producer<'static, u32, U4>, c: Consumer<'static, u32, U4>, } #[init] fn init(_: init::Context) -> init::LateResources { static mut Q: Queue<u32, U4> = Queue(i::Queue::new()); let (p, c) = Q.split(); // Initialization of late resources init::LateResources { p, c } } #[idle(resources = [c])] fn idle(c: idle::Context) -> ! { loop { if let Some(byte) = c.resources.c.dequeue() { hprintln!("received message: {}", byte).unwrap(); debug::exit(debug::EXIT_SUCCESS); } else { rtic::pend(Interrupt::UART0); } } } #[task(binds = UART0, resources = [p])] fn uart0(c: uart0::Context) { c.resources.p.enqueue(42).unwrap(); }
}; $ cargo run --example late
received message: 42

