The spawn API returns the Err variant when there's no space to send the message. In most scenarios spawning errors are handled in one of two ways: Panicking, using unwrap, expect, etc. This approach is used to catch the programmer error (i.e. bug) of selecting a capacity that was too small. When this panic is encountered during testing choosing a bigger capacity and recompiling the program may fix the issue but sometimes it's necessary to dig deeper and perform a timing analysis of the application to check if the platform can deal with peak payload or if the processor needs to be replaced with a faster one. Ignoring the result. In soft real time and non real time applications it may be OK to occasionally lose data or fail to respond to some events during event bursts. In those scenarios silently letting a spawn call fail may be acceptable. It should be noted that retrying a spawn call is usually the wrong approach as this operation will likely never succeed in practice. Because there are only context switches towards higher priority tasks retrying the spawn call of a lower priority task will never let the scheduler dispatch said task meaning that its message buffer will never be emptied. This situation is depicted in the following snippet: #[rtic::app(..)]
const APP: () = { #[init(spawn = [foo, bar])] fn init(cx: init::Context) { cx.spawn.foo().unwrap(); cx.spawn.bar().unwrap(); } #[task(priority = 2, spawn = [bar])] fn foo(cx: foo::Context) { // .. // the program will get stuck here while cx.spawn.bar(payload).is_err() { // retry the spawn call if it failed } } #[task(priority = 1)] fn bar(cx: bar::Context, payload: i32) { // .. }
};

