Send is a marker trait for "types that can be transferred across thread boundaries", according to its definition in core. In the context of RTIC the Send trait is only required where it's possible to transfer a value between tasks that run at different priorities. This occurs in a few places: in message passing, in shared resources and in the initialization of late resources. The app attribute will enforce that Send is implemented where required so you don't need to worry much about it. It's more important to know where you do not need the Send trait: on types that are transferred between tasks that run at the same priority. This occurs in two places: in message passing and in shared resources. The example below shows where a type that doesn't implement Send can be used. //! `examples/not-send.rs` #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] use core::marker::PhantomData; use cortex_m_semihosting::debug;
use panic_halt as _;
use rtic::app; pub struct NotSend { _0: PhantomData<*const ()>,
} #[app(device = lm3s6965)]
const APP: () = { struct Resources { #[init(None)] shared: Option<NotSend>, } #[init(spawn = [baz, quux])] fn init(c: init::Context) { c.spawn.baz().unwrap(); c.spawn.quux().unwrap(); } #[task(spawn = [bar])] fn foo(c: foo::Context) { // scenario 1: message passed to task that runs at the same priority c.spawn.bar(NotSend { _0: PhantomData }).ok(); } #[task] fn bar(_: bar::Context, _x: NotSend) { // scenario 1 } #[task(priority = 2, resources = [shared])] fn baz(c: baz::Context) { // scenario 2: resource shared between tasks that run at the same priority *c.resources.shared = Some(NotSend { _0: PhantomData }); } #[task(priority = 2, resources = [shared])] fn quux(c: quux::Context) { // scenario 2 let _not_send = c.resources.shared.take().unwrap(); debug::exit(debug::EXIT_SUCCESS); } extern "C" { fn UART0(); fn UART1(); }
}; It's important to note that late initialization of resources is effectively a send operation where the initial value is sent from the background context, which has the lowest priority of 0, to a task, which will run at a priority greater than or equal to 1. Thus all late resources need to implement the Send trait, except for those exclusively accessed by idle, which runs at a priority of 0. Sharing a resource with init can be used to implement late initialization, see example below. For that reason, resources shared with init must also implement the Send trait. //! `examples/shared-with-init.rs` #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] use cortex_m_semihosting::debug;
use lm3s6965::Interrupt;
use panic_halt as _;
use rtic::app; pub struct MustBeSend; #[app(device = lm3s6965)]
const APP: () = { struct Resources { #[init(None)] shared: Option<MustBeSend>, } #[init(resources = [shared])] fn init(c: init::Context) { // this `message` will be sent to task `UART0` let message = MustBeSend; *c.resources.shared = Some(message); rtic::pend(Interrupt::UART0); } #[task(binds = UART0, resources = [shared])] fn uart0(c: uart0::Context) { if let Some(message) = c.resources.shared.take() { // `message` has been received drop(message); debug::exit(debug::EXIT_SUCCESS); } }
};

