Resources may appear in contexts as resource proxies or as unique references (&mut-) depending on the priority of the task. Because the same resource may appear as different types in different contexts one cannot refactor a common operation that uses resources into a plain function; however, such refactor is possible using generics . All resource proxies implement the rtic::Mutex trait. On the other hand, unique references (&mut-) do not implement this trait (due to limitations in the trait system) but one can wrap these references in the rtic::Exclusive newtype which does implement the Mutex trait. With the help of this newtype one can write a generic function that operates on generic resources and call it from different tasks to perform some operation on the same set of resources. Here's one such example: //! examples/generics.rs #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] use cortex_m_semihosting::{debug, hprintln};
use lm3s6965::Interrupt;
use panic_semihosting as _;
use rtic::{Exclusive, Mutex}; #[rtic::app(device = lm3s6965)]
const APP: () = { struct Resources { #[init(0)] shared: u32, } #[init] fn init(_: init::Context) { rtic::pend(Interrupt::UART0); rtic::pend(Interrupt::UART1); } #[task(binds = UART0, resources = [shared])] fn uart0(c: uart0::Context) { static mut STATE: u32 = 0; hprintln!("UART0(STATE = {})", *STATE).unwrap(); // second argument has type `resources::shared` advance(STATE, c.resources.shared); rtic::pend(Interrupt::UART1); debug::exit(debug::EXIT_SUCCESS); } #[task(binds = UART1, priority = 2, resources = [shared])] fn uart1(c: uart1::Context) { static mut STATE: u32 = 0; hprintln!("UART1(STATE = {})", *STATE).unwrap(); // just to show that `shared` can be accessed directly *c.resources.shared += 0; // second argument has type `Exclusive<u32>` advance(STATE, Exclusive(c.resources.shared)); }
}; // the second parameter is generic: it can be any type that implements the `Mutex` trait
fn advance(state: &mut u32, mut shared: impl Mutex<T = u32>) { *state += 1; let (old, new) = shared.lock(|shared: &mut u32| { let old = *shared; *shared += *state; (old, *shared) }); hprintln!("shared: {} -> {}", old, new).unwrap();
} $ cargo run --example generics
UART1(STATE = 0)
shared: 0 -> 1
UART0(STATE = 0)
shared: 1 -> 2
UART1(STATE = 1)
shared: 2 -> 4 Using generics also lets you change the static priorities of tasks during development without having to rewrite a bunch code every time.

