For simplicity, let's look at a resource shared by two tasks that run at different priorities. Clearly one of the task can preempt the other; to prevent a data race the lower priority task must use a critical section when it needs to modify the shared memory. On the other hand, the higher priority task can directly modify the shared memory because it can't be preempted by the lower priority task. To enforce the use of a critical section on the lower priority task we give it a resource proxy , whereas we give a unique reference (&mut-) to the higher priority task. The example below shows the different types handed out to each task: #[rtic::app(device = ..)]
const APP: () = { struct Resources { #[init(0)] x: u64, } #[interrupt(binds = UART0, priority = 1, resources = [x])] fn foo(c: foo::Context) { // resource proxy let mut x: resources::x = c.resources.x; x.lock(|x: &mut u64| { // critical section *x += 1 }); } #[interrupt(binds = UART1, priority = 2, resources = [x])] fn bar(c: bar::Context) { let mut x: &mut u64 = c.resources.x; *x += 1; } // ..
}; Now let's see how these types are created by the framework. fn foo(c: foo::Context) { // .. user code ..
} fn bar(c: bar::Context) { // .. user code ..
} pub mod resources { pub struct x { // .. }
} pub mod foo { pub struct Resources { pub x: resources::x, } pub struct Context { pub resources: Resources, // .. }
} pub mod bar { pub struct Resources<'a> { pub x: &'a mut u64, } pub struct Context { pub resources: Resources, // .. }
} const APP: () = { static mut x: u64 = 0; impl rtic::Mutex for resources::x { type T = u64; fn lock<R>(&mut self, f: impl FnOnce(&mut u64) -> R) -> R { // we'll check this in detail later } } #[no_mangle] unsafe fn UART0() { foo(foo::Context { resources: foo::Resources { x: resources::x::new(/* .. */), }, // .. }) } #[no_mangle] unsafe fn UART1() { bar(bar::Context { resources: bar::Resources { x: &mut x, }, // .. }) }
};

