Let's now zoom into the critical section itself. In this example, we have to raise the dynamic priority to at least 2 to prevent a data race. On the Cortex-M architecture the dynamic priority can be changed by writing to the BASEPRI register. The semantics of the BASEPRI register are as follows: Writing a value of 0 to BASEPRI disables its functionality. Writing a non-zero value to BASEPRI changes the priority level required for interrupt preemption. However, this only has an effect when the written value is lower than the priority level of current execution context, but note that a lower hardware priority level means higher logical priority Thus the dynamic priority at any point in time can be computed as dynamic_priority = max(hw2logical(BASEPRI), hw2logical(static_priority)) Where static_priority is the priority programmed in the NVIC for the current interrupt, or a logical 0 when the current context is idle. In this particular example we could implement the critical section as follows: NOTE: this is a simplified implementation impl rtic::Mutex for resources::x { type T = u64; fn lock<R, F>(&mut self, f: F) -> R where F: FnOnce(&mut u64) -> R, { unsafe { // start of critical section: raise dynamic priority to `2` asm!("msr BASEPRI, 192" : : : "memory" : "volatile"); // run user code within the critical section let r = f(&mut x); // end of critical section: restore dynamic priority to its static value (`1`) asm!("msr BASEPRI, 0" : : : "memory" : "volatile"); r } }
} Here it's important to use the "memory" clobber in the asm! block. It prevents the compiler from reordering memory operations across it. This is important because accessing the variable x outside the critical section would result in a data race. It's important to note that the signature of the lock method prevents nesting calls to it. This is required for memory safety, as nested calls would produce multiple unique references (&mut-) to x breaking Rust aliasing rules. See below: #[interrupt(binds = UART0, priority = 1, resources = [x])]
fn foo(c: foo::Context) { // resource proxy let mut res: resources::x = c.resources.x; res.lock(|x: &mut u64| { res.lock(|alias: &mut u64| { //~^ error: `res` has already been uniquely borrowed (`&mut-`) // .. }); });
}

