Nesting calls to lock on the same resource must be rejected by the compiler for memory safety but nesting lock calls on different resources is a valid operation. In that case we want to make sure that nesting critical sections never results in lowering the dynamic priority, as that would be unsound, and we also want to optimize the number of writes to the BASEPRI register and compiler fences. To that end we'll track the dynamic priority of the task using a stack variable and use that to decide whether to write to BASEPRI or not. In practice, the stack variable will be optimized away by the compiler but it still provides extra information to the compiler. Consider this program: #[rtic::app(device = ..)]
const APP: () = { struct Resources { #[init(0)] x: u64, #[init(0)] y: u64, } #[init] fn init() { rtic::pend(Interrupt::UART0); } #[interrupt(binds = UART0, priority = 1, resources = [x, y])] fn foo(c: foo::Context) { let mut x = c.resources.x; let mut y = c.resources.y; y.lock(|y| { *y += 1; *x.lock(|x| { x += 1; }); *y += 1; }); // mid-point x.lock(|x| { *x += 1; y.lock(|y| { *y += 1; }); *x += 1; }) } #[interrupt(binds = UART1, priority = 2, resources = [x])] fn bar(c: foo::Context) { // .. } #[interrupt(binds = UART2, priority = 3, resources = [y])] fn baz(c: foo::Context) { // .. } // ..
}; The code generated by the framework looks like this: // omitted: user code pub mod resources { pub struct x<'a> { priority: &'a Cell<u8>, } impl<'a> x<'a> { pub unsafe fn new(priority: &'a Cell<u8>) -> Self { x { priority } } pub unsafe fn priority(&self) -> &Cell<u8> { self.priority } } // repeat for `y`
} pub mod foo { pub struct Context { pub resources: Resources, // .. } pub struct Resources<'a> { pub x: resources::x<'a>, pub y: resources::y<'a>, }
} const APP: () = { use cortex_m::register::basepri; #[no_mangle] unsafe fn UART1() { // the static priority of this interrupt (as specified by the user) const PRIORITY: u8 = 2; // take a snashot of the BASEPRI let initial = basepri::read(); let priority = Cell::new(PRIORITY); bar(bar::Context { resources: bar::Resources::new(&priority), // .. }); // roll back the BASEPRI to the snapshot value we took before basepri::write(initial); // same as the `asm!` block we saw before } // similarly for `UART0` / `foo` and `UART2` / `baz` impl<'a> rtic::Mutex for resources::x<'a> { type T = u64; fn lock<R>(&mut self, f: impl FnOnce(&mut u64) -> R) -> R { unsafe { // the priority ceiling of this resource const CEILING: u8 = 2; let current = self.priority().get(); if current < CEILING { // raise dynamic priority self.priority().set(CEILING); basepri::write(logical2hw(CEILING)); let r = f(&mut y); // restore dynamic priority basepri::write(logical2hw(current)); self.priority().set(current); r } else { // dynamic priority is high enough f(&mut y) } } } } // repeat for resource `y`
}; At the end the compiler will optimize the function foo into something like this: fn foo(c: foo::Context) { // NOTE: BASEPRI contains the value `0` (its reset value) at this point // raise dynamic priority to `3` unsafe { basepri::write(160) } // the two operations on `y` are merged into one y += 2; // BASEPRI is not modified to access `x` because the dynamic priority is high enough x += 1; // lower (restore) the dynamic priority to `1` unsafe { basepri::write(224) } // mid-point // raise dynamic priority to `2` unsafe { basepri::write(192) } x += 1; // raise dynamic priority to `3` unsafe { basepri::write(160) } y += 1; // lower (restore) the dynamic priority to `2` unsafe { basepri::write(192) } // NOTE: it would be sound to merge this operation on `x` with the previous one but // compiler fences are coarse grained and prevent such optimization x += 1; // lower (restore) the dynamic priority to `1` unsafe { basepri::write(224) } // NOTE: BASEPRI contains the value `224` at this point // the UART0 handler will restore the value to `0` before returning
}

